import React from "react";
import { useParams } from 'react-router-dom'

export const Blog = ({single}) => {
  let {id} = useParams();
  return (
    <>
      <div className="stock-container">
         
              return(
                  <div >
                      <h3>{single.name}</h3>
                      <p>{single.year}</p>
                      <img src={single.image} alt="hi"></img>
                      <p>{single.body}</p>
                  </div>
                  
              )
      
      </div>
    </>
  );
};
